// Remove VCS simv option from argv if it match pattern -X???=
void remove_vcs_simv_opt(int & argc, char **& argv){
    int idx = 0;
    while(idx < argc){
        std::string str = std::string(argv[idx]);
        if(str.length() > 1 && str[0] == '-' && str[1] != '-' && str.find('=') != std::string::npos){
            // Found -????=???? as VCS simv option
            for(int i = idx; i < argc - 1; i++){
                // Remove the current option
                argv[i] = argv[i + 1];
            }
            argc--;
        }else{
            idx++;
        }
    }
}

extern "C" int tsi_tick(
                        int chip_id,
                        unsigned char out_valid,
                        unsigned char *out_ready,
                        int out_bits,

                        unsigned char *in_valid,
                        unsigned char in_ready,
                        int *in_bits)
{
    bool out_fire = *out_ready && out_valid;
    bool in_fire = *in_valid && in_ready;
    bool in_free = !(*in_valid);

    auto it = tsis.find(chip_id);

    if (it == tsis.end()) {
        s_vpi_vlog_info info;
        if (!vpi_get_vlog_info(&info))
          abort();

        // Prevent simv option enter htif
        remove_vcs_simv_opt(info.argc, info.argv);

        // TODO: We should somehow inspect whether or not our backing memory supports loadmem, instead of unconditionally setting it to true
        tsis[chip_id] = new testchip_tsi_t(info.argc, info.argv, true);
    }

    testchip_tsi_t* tsi = tsis[chip_id];
    tsi->tick(out_valid, out_bits, in_ready);
    tsi->switch_to_host();

    *in_valid = tsi->in_valid();
    *in_bits = tsi->in_bits();
    *out_ready = tsi->out_ready();

    return tsi->done() ? (tsi->exit_code() << 1 | 1) : 0;
}

#include "testchip_htif.h"

void testchip_htif_t::parse_htif_args(std::vector<std::string> &args) {
  for (auto& arg : args) {
    if (arg.find("+init_write=0x") == 0) {
      auto d = arg.find(":0x");
      if (d == std::string::npos) {
        throw std::invalid_argument("Improperly formatted +init_write argument");
      }
      uint64_t addr = strtoull(arg.substr(14, d - 14).c_str(), 0, 16);
      uint32_t val = strtoull(arg.substr(d + 3).c_str(), 0, 16);
      init_access_t access = { .address=addr, .stdata=val, .store=true };
      init_accesses.push_back(access);
    }
    if (arg.find("+init_read=0x") == 0) {
      uint64_t addr = strtoull(arg.substr(13).c_str(), 0, 16);
      init_access_t access = { .address=addr, .stdata=0, .store=false };
      init_accesses.push_back(access);
    }
    if (arg.find("+no_hart0_msip") == 0)
      write_hart0_msip = false;
  }
}

void testchip_htif_t::perform_init_accesses() {
  for (auto p : init_accesses) {
    if (p.store) {
      fprintf(stderr, "Writing %lx with %x\n", p.address, p.stdata);
      write_chunk(p.address, sizeof(uint32_t), &p.stdata);
      fprintf(stderr, "Done writing %lx with %x\n", p.address, p.stdata);
    } else {
      fprintf(stderr, "Reading %lx ...", p.address);
      uint32_t rdata = 0;
      read_chunk(p.address, sizeof(uint32_t), &rdata);
      fprintf(stderr, " got %x\n", rdata);
    }
  }
}

#ifndef __TESTCHIP_HTIF_H
#define __TESTCHIP_HTIF_H

#include <stdexcept>
#include <stdint.h>
#include <vector>
#include <string>
#include <fesvr/htif.h>

struct init_access_t {
  uint64_t address;
  uint32_t stdata;
  bool store;
};

class testchip_htif_t
{
 public:
  virtual void write_chunk(addr_t taddr, size_t nbytes, const void* src) = 0;
  virtual void read_chunk(addr_t taddr, size_t nbytes, void* dst) = 0;
  virtual ~testchip_htif_t() {};

 protected:
  void perform_init_accesses();
  void parse_htif_args(std::vector<std::string> &args);
  bool write_hart0_msip = true;
  std::vector<init_access_t> init_accesses;
};
#endif

#include "testchip_tsi.h"
#include <stdexcept>

testchip_tsi_t::testchip_tsi_t(int argc, char** argv, bool can_have_loadmem) : tsi_t(argc, argv)
{
  has_loadmem = false;
  init_accesses = std::vector<init_access_t>();
  write_hart0_msip = true;
  is_loadmem = false;
  cflush_addr = 0;
  std::vector<std::string> args(argv + 1, argv + argc);
  for (auto& arg : args) {
    if (arg.find("+loadmem=") == 0)
      has_loadmem = can_have_loadmem;
    if (arg.find("+cflush_addr=0x") == 0)
      cflush_addr = strtoull(arg.substr(15).c_str(), 0, 16);
  }

  testchip_htif_t::parse_htif_args(args);
}

void testchip_tsi_t::flush_cache_lines(addr_t taddr, size_t nbytes) {
  if (!cflush_addr) return;
  static size_t cblock_bytes = 64;
  addr_t base = taddr & ~(cblock_bytes-1);
  while (base < taddr + nbytes) {
    uint32_t data[2] { (uint32_t)base, (uint32_t)(base >> 32) };
    tsi_t::write_chunk(cflush_addr, 8, data);
    base += cblock_bytes;
  }
}

void testchip_tsi_t::write_chunk(addr_t taddr, size_t nbytes, const void* src)
{
  if (is_loadmem) {
    load_mem_write(taddr, nbytes, src);
  } else {
    flush_cache_lines(taddr, nbytes);
    tsi_t::write_chunk(taddr, nbytes, src);
  }
}

void testchip_tsi_t::read_chunk(addr_t taddr, size_t nbytes, void* dst)
{
  if (is_loadmem) {
    load_mem_read(taddr, nbytes, dst);
  } else {
    flush_cache_lines(taddr, nbytes);
    tsi_t::read_chunk(taddr, nbytes, dst);
  }
}

void testchip_tsi_t::reset()
{
  testchip_htif_t::perform_init_accesses();
  if (write_hart0_msip)
    tsi_t::reset();
}

#ifndef __TESTCHIP_TSI_H
#define __TESTCHIP_TSI_H

#include <stdexcept>

#include <fesvr/tsi.h>
#include <fesvr/htif.h>
#include "testchip_htif.h"

class testchip_tsi_t : public tsi_t, public testchip_htif_t
{
 public:
  testchip_tsi_t(int argc, char** argv, bool has_loadmem);
  virtual ~testchip_tsi_t() {};

  void write_chunk(addr_t taddr, size_t nbytes, const void* src) override;
  void read_chunk(addr_t taddr, size_t nbytes, void* dst) override;
  void load_program() {
    switch_to_target();
    is_loadmem = has_loadmem;
    tsi_t::load_program();
    is_loadmem = false;
  }
  void idle() { switch_to_target(); }

 protected:
  virtual void load_mem_write(addr_t taddr, size_t nbytes, const void* src) { };
  virtual void load_mem_read(addr_t taddr, size_t nbytes, void* dst) { };
  void flush_cache_lines(addr_t taddr, size_t nbytes);
  void reset() override;
  bool has_loadmem;

 private:

  bool is_loadmem;
  addr_t cflush_addr;
};
#endif

